import React from 'react'
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import Button from '@material-ui/core/Button'
import { makeStyles, useTheme } from '@material-ui/core/styles'
import AnchorLink from 'react-anchor-link-smooth-scroll'
import IconButton from '@material-ui/core/IconButton';
import clsx from 'clsx';
import MenuIcon from '@material-ui/icons/Menu';
import Drawer from '@material-ui/core/Drawer';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';

const useStyles = makeStyles((theme) => ({
    anchor: {
        textDecoration : 'none',
        color : 'inherit'
    }
}));

function Header(props) {
    const classes = useStyles();
    const [open, setOpen] = React.useState(false);
    const theme = useTheme();
    const setTag = props.setTag;
    console.log(setTag);

    const handleDrawerOpen = () => {
        setOpen(true);
    };

    const handleDrawerClose = () => {
        setOpen(false);
    };

    function handleTag(tags){
        setTag(tags);
    }

    return (
        <>
        <AppBar
        color='default'
        position='static'
        >
            <Toolbar>
            <IconButton
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            edge="start"
            className={clsx(classes.menuButton, open && classes.hide)}
          >
            <MenuIcon />
          </IconButton>
          <Drawer
        className={classes.drawer}
        variant="persistent"
        anchor="left"
        open={open}
        classes={{
          paper: classes.drawerPaper,
        }}
      >
        <div className={classes.drawerHeader}>
          <IconButton onClick={handleDrawerClose}>
            {theme.direction === 'ltr' ? <ChevronLeftIcon /> : <ChevronRightIcon />}
          </IconButton>
        </div>
        <Divider />
        {/* <List> */}
            {/* <ListItem button > */}
                <Button onClick={handleTag("bag")} >bag</Button>
            {/* </ListItem> */}
            <ListItem button>
                <Button onClick={handleTag("cap")} />
            </ListItem>
            <ListItem button>
                <ListItemText primary="glass" onClick={handleTag("glass")} />
            </ListItem>
            <ListItem button>
                <ListItemText primary="jacket" onClick={handleTag("jacket")} />
            </ListItem>
            <ListItem button>
                <ListItemText primary="jeans" onClick={handleTag("jeans")} />
            </ListItem>
            <ListItem button>
                <ListItemText primary="shirt" onClick={handleTag("shirt")} />
            </ListItem>
            <ListItem button>
                <ListItemText primary="shoes" onClick={handleTag("shoes")} />
            </ListItem>
            <ListItem button>
                <ListItemText primary="all" onClick={handleTag("all")} />
            </ListItem>
         {/* </List> */}
      </Drawer>
      <div style={{ alignItems: 'center' }}>
                <AnchorLink href="#about"
                    className={classes.anchor}>
                    <Button>
                        HOME
                    </Button>
                </AnchorLink>

                <AnchorLink href="#contact" className={classes.anchor}>
                    <Button color='inherit'>
                        CONTACT
                    </Button>
                </AnchorLink>
        </div>
            </Toolbar>
        </AppBar>
    </>
    )
}

export default Header
